import React, {useState} from 'react';
import styled from '@emotion/styled';

const Nav = styled.div`
    display: inline-block;
`;

const Item = styled.button`
    background-color: transparent;
    border: none;
    color: white;
    text-transform: uppercase;
    transition: all .3s ease;
    &:hover {
        color: var(--colorNaranja);
    }
    &:focus {
        outline: none;
    }
`;

const NavegacionMenu = () => {
    
    const [seleccion, setSeleccion] = useState(null);

    return (
        <div className="py-5 mx-auto text-center">
            <Nav>
                <Item
                    onClick={() => setSeleccion('comidas')}
                >Comidas</Item>
                <Item
                    onClick={() => setSeleccion('vinos')}
                >Vinos</Item>
                <Item
                    onClick={() => setSeleccion('cocteleria')}
                >Cocteler√≠a</Item>
                <Item
                    onClick={() => setSeleccion('bebidas')}
                >Bebidas</Item>
            </Nav>
        </div>
    );
}
 
export default NavegacionMenu;
